    winrt::Microsoft::UI::Xaml::Controls::IAnimatedVisual LottieWalkthrough::TryCreateAnimatedVisual(
        Compositor const& compositor,
        IInspectable& diagnostics)
    {
        diagnostics = nullptr;

        if (LottieWalkthrough_AnimatedVisual::IsRuntimeCompatible())
        {
            return winrt::make<LottieWalkthrough_AnimatedVisual>(compositor);
        }

        return nullptr;
    }

    double LottieWalkthrough::FrameToProgress(double frameNumber)
    {
        return frameNumber / 181.0;
    }

